import React, { Component } from 'react';
import { Table } from 'semantic-ui-react';
import container from '../ethereum/container';


class ReviewIndex extends Component {

    static async getInitialProps(){
        const info = await container.methods.GetUserInfo().call();

        return {
            ContainerNo: info[0],
            WarehouseNo: info[1],
            ProductName: info[2],
            HalalStatus: info[3],
            Quantity: info[4]
        };
    }

    renderInfo() {
        const{
            ContainerNo,
            WarehouseNo,
            ProductName,
            HalalStatus,
            Quantity
        } = this.props;

        
    }

    render(){
        return(
            <div>
            <h3>Container Record</h3>
            <Table>
                <Header>
                    <Row>
                        <HeaderCell>Container ID</HeaderCell>
                        <HeaderCell>Warehouse ID</HeaderCell>
                        <HeaderCell>Product Name</HeaderCell>
                        <HeaderCell>Halal Status</HeaderCell>
                        <HeaderCell>Quantity</HeaderCell>
                    </Row>
                </Header>
                <Body></Body>
            </Table>
            </div>
        );
    }
}
export default ReviewIndex;
